import React, { useRef } from 'react';

import { IonContent, IonPage, IonGrid, IonRow, IonCol, IonLabel, IonInput, IonButton, IonicSwiper } from '@ionic/react';

import SwiperCore, { Navigation, Pagination } from 'swiper';
import { Swiper, SwiperSlide } from 'swiper/react';

import Header from '../components/Header';

import 'swiper/swiper-bundle.min.css';
import '@ionic/react/css/ionic-swiper.css';
import '../assets/css/Custom.css';
import '../assets/css/Responsive.css';

SwiperCore.use([IonicSwiper, Navigation, Pagination]);

const ManagementSignup: React.FC = () => {
const sliderRef = useRef();
const swipeNext = () => {
    // sliderRef.slide.slideNext();
}

  return (
    <IonPage>

        <Header />

        <IonContent fullscreen>
            <IonGrid>
                <IonRow className="signup-form login-form-row">
                    <IonCol size="10" sizeMd="6" sizeLg="4">
                        <Swiper
                            allowTouchMove= {false}
                            pagination={{
                                clickable: true
                            }}
                        >
                            <SwiperSlide>
                                <IonGrid>
                                    <IonRow>
                                        <IonCol size="12" className="email-field">
                                            <IonLabel className="form-lable">Email*</IonLabel>
                                            <IonInput type="email" placeholder="Email"/>
                                        </IonCol>

                                        <IonCol size="12" className="password-field">
                                            <IonLabel className="form-lable">Password*</IonLabel>
                                            <IonInput type="password" placeholder="Password" />
                                        </IonCol>

                                        <IonCol size="12" className="forget-password">
                                            <IonLabel className="form-lable">Confirm Password*</IonLabel>
                                            <IonInput type="password" placeholder="Confirm Password" />
                                        </IonCol>

                                        <IonCol size="6" className="sign-up-btn">
                                            <IonButton expand="block" shape="round" fill="outline" onClick={swipeNext}>
                                                Continue
                                            </IonButton>
                                        </IonCol>

                                    </IonRow>
                                </IonGrid>
                            </SwiperSlide>

                            <SwiperSlide>
                                <IonGrid>
                                    <IonRow>

                                        <IonCol size="12" className="email-field">
                                            <IonLabel className="form-lable">First Name:</IonLabel>
                                            <IonInput type="text" placeholder="First Name"/>
                                        </IonCol>

                                        <IonCol size="12" className="email-field">
                                            <IonLabel className="form-lable">Last Name:</IonLabel>
                                            <IonInput type="text" placeholder="Last Name"/>
                                        </IonCol>

                                        <IonCol size="12" className="email-field">
                                            <IonLabel className="form-lable">Telephone:</IonLabel>
                                            <IonInput type="email" placeholder="Telephone"/>
                                        </IonCol>

                                        <IonCol size="6" className="sign-up-btn">
                                            <IonButton href="/Signup" expand="block" shape="round" fill="outline">
                                            Sign Up
                                            </IonButton>
                                        </IonCol>

                                    </IonRow>
                                </IonGrid>
                            </SwiperSlide>

                        </Swiper>
                    </IonCol>

                </IonRow>
            </IonGrid>
        </IonContent>

    </IonPage>
  );
};

export default ManagementSignup;
